  render(){
    return(
      <div id="searchBar">
        <div id="logoDiv">
          <img id="logoImg"src={logo}/>
        </div>
        <div id="inputDiv">
          <spam><FiSearch/></spam>
          <input id="searchInput" type="text"/>
        </div>
      </div>
    );
  }
}

